  const [navCheck,setNavCheck] = useState(false);

  const handleNavCheck = () => {
    setNavCheck(true);
  }
  return (
    <>
     <Navbar></Navbar>
      <Routes>

        <Route path = "/" Component={Home}></Route>
        <Route path = '*' Component={Error}></Route>

      </Routes>
      <Footer></Footer>
    </>

  );
}

export default App;
